import { HttpClient } from '@angular/common/http';
import { Component } from '@angular/core';
import { Router } from '@angular/router';

@Component({
  selector: 'app-travel-packageform',
  templateUrl: './travel-packageform.component.html',
  styleUrls: ['./travel-packageform.component.css']
})
export class TravelPackageformComponent {


  constructor(private http: HttpClient, private router: Router) 
  {
    { 
    
      this.http.get("http://localhost:8000/api/alldestination")
    
      .subscribe((resultData: any)=>
      {
        this.destinations=resultData
        console.log(this.destinations)
      });
    }


  { 
    
    this.http.get("http://localhost:8000/api/allairline")
  
    .subscribe((resultData: any)=>
    {
      this.airlines=resultData
      console.log(this.airlines)
    });
  }

  }

  name=""
  description=""
  price=""
  destination_id=""
  airline_id=""
  departure=""
  return=""



  destinations:any
  airlines: any
  airlineflag: boolean =false
  flights: any
  



// getFlight(airline: any)

//   { 
    

    
//     this.http.post("http://localhost:8000/api/flightselector/${airline}")
  
//     .subscribe((resultData: any)=>
//     {
//       this.flights=resultData

//       this.airlineflag=true
//       console.log(resultData.destinations)
//       console.log(this.flights)
//     });

// }


getFlight(airlineId: any): void {
  this.http.get(`http://localhost:8000/api/flightselector/${airlineId}`)
    .subscribe((resultData: any) => {
      this.flights = resultData;
      this.airlineflag = true;
      console.log(this.flights);
    });
}






  package_sub()
  {
    let bodyData = {
      "name" : this.name,
      "price" : this.price,
      "description" : this.description,
      "destination_id" : this.destination_id,
      "airline_id" : this.airline_id,
      "departure" : this.departure,
      "return" : this.return
    };


    this.http.post("http://localhost:8000/api/travel-package/create",bodyData).subscribe((resultData: any)=> 
    {

        alert(resultData["message"] + resultData["package"].name + " has been registered")
        // this.router.navigate(['/login'])

    });
    console.log("This runs")
    
  }
  

}
<div class="container mt-4" >

    <div class="card">
        <h1>Travel Package Form</h1>
  
  <form>
    <div class="form-group">
      <label>Name</label>
      <input type="text" [(ngModel)]="name" [ngModelOptions]="{standalone: true}" class="form-control" id="name" placeholder="Enter Nmae">
  
    </div>
  
    <div class="form-group">
        <label>Price</label>
        <input type="text" [(ngModel)]="price" [ngModelOptions]="{standalone: true}" class="form-control" id="email" placeholder="Enter Price">
  
      </div>
  
      <div class="form-group">
        <label>Destination</label>
        <select [(ngModel)]="destination_id" [ngModelOptions]="{standalone: true}" class="form-control" id="destination">
          <option *ngFor="let destination of destinations" [value]="destination.id">{{ destination.country }}</option>
        </select>
      </div>
      <div class="form-group">
        <label>Description</label>
        <textarea type="text" [(ngModel)]="description" [ngModelOptions]="{standalone: true}" class="form-control" id="password" placeholder="Enter Description"></textarea>
      </div>
      <div class="form-group">
        <label>Airline</label>
        <select [(ngModel)]="airline_id" [ngModelOptions]="{standalone: true}" class="form-control" id="airline">
          <option *ngFor="let airline of airlines" [value]="airline.id" (click)="getFlight(airline.id)">{{ airline.name }}</option>
        </select>
      </div>
      <div *ngIf="airlineflag">
      <label>Departure Flight</label>
      <select [(ngModel)]="departure" [ngModelOptions]="{standalone: true}" class="form-control" id="flight">
        <option *ngFor="let flight of flights" [value]="flight.id" >Time: {{flight.departure}}, Destination: {{flight.destination.country}}</option>
      </select>
    </div>
    <div *ngIf="airlineflag">
        <label>Return Flight</label>
        <select [(ngModel)]="return" [ngModelOptions]="{standalone: true}" class="form-control" id="flight">
            <option *ngFor="let flight of flights" [value]="flight.id" >Time: {{flight.departure}}, Destination: {{flight.destination.country}}</option>
        </select>
      </div>
    
      <button type="submit" class="btn btn-primary mt-4" (click)="package_sub()" >Submit</button>
      <!--<p *ngIf="message !== null && message !== undefined">{{message.name}} has been registered</p> -->
  </form>
    </div>
  <div>
